description:
A group of kids go to a Halloween party, only to have to face down a group of demons.

Angela is throwing a decadent Halloween part at New Orleans\' infamous Broussard Mansion. But after the police break up the festivities, Maddie and a few friends stay behind. Trapped inside the locked mansion gates, the remaining guests uncover a horrifying secret and soon fall victim to seven vicious, blood-thirsty demons...

